CREATE TABLE crm.sys_log
(
    log_id bigint(20) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    create_date datetime,
    error_message varchar(4000),
    ip varchar(255),
    method varchar(255),
    module_name varchar(255),
    operation varchar(255),
    params varchar(255),
    result varchar(4000),
    status varchar(255),
    time bigint(20),
    url varchar(255),
    user_name varchar(255)
);
